import React from 'react'
import { Droppable, DragDropContext, Draggable } from 'react-beautiful-dnd'
function Test() {

    const data1 = [
        { id: 1, data: 1 },
        { id: 2, data: 2 },
        { id: 3, data: 3 }
    ]
    const data2 = [4, 5, 6]


    return (
        <div>
            <DragDropContext>
                <Droppable droppableId="characters">
                    {data1.map((item,i) => <Draggable
                    key={item.id}
                    draggableId = {item.id}
                    index = {i}
                    >
                    {item.data}
                    </Draggable> )}
                </Droppable>
            </DragDropContext>
        </div>
    )
}

export default Test

